import React from 'react'
import "./App.css";
import MeImage from "./images/me.png";
export default function Heading() {
    return (
        <div className="padded">
            <h1>Hi! I'm Jesse</h1>
            <h3>Software Engineer, Entrepreneur, Investor</h3>
            <img src={MeImage} alt={"An image of me."} width="10vw"/>
        </div>
    )
}
